app.factory("Data",["$http","toaster",function(t,n){var e="../../model/v1/",u={};return u.toast=function(t){n.pop(t.status,"",t.message,1e4,"trustedHtml")},u.get=function(n){return t.get(e+n).then(function(t){return t.data})},u.post=function(n,u){return t.post(e+n,u).then(function(t){return t.data})},u.put=function(n,u){return t.put(e+n,u).then(function(t){return t.data})},u.delete=function(n){return t.delete(e+n).then(function(t){return t.data})},u}]);